import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialScreenshot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialScreenshot });
    screenshots.push(initialScreenshot);

    // Wait for at least one product card to be rendered (use text in product title as anchor)
    await page.waitForSelector('text="Apple iPhone 15 Pro Max"');

    // Wait for all .product-price elements to be present (grid view)
    await page.waitForSelector('.product-price');

    // Take screenshot after products loaded
    const afterProductsScreenshot = path.join(screenshotsDir, 'step_2_products_loaded.png');
    await page.screenshot({ path: afterProductsScreenshot });
    screenshots.push(afterProductsScreenshot);

    // Extract all product prices (use multiple selector strategies)
    // 1. Try grid view: .product-card .product-price
    // 2. Try list view: .product-card-list .product-price
    // 3. Fallback: any visible .product-price

    // Scroll to bottom to ensure all products are loaded (if lazy loading)
    await page.evaluate(() => window.scrollTo(0, document.body.scrollHeight));
    await page.waitForTimeout(500);

    // Extract price data
    const prices = await page.evaluate(() => {
      // Helper to extract price text and original price (if any)
      function extractPricesFromSelector(selector) {
        const priceNodes = Array.from(document.querySelectorAll(selector));
        return priceNodes.map(node => {
          // Main price
          const priceText = node.childNodes[0]?.textContent?.trim() || node.textContent.trim();
          // Original price (if present as .original-price)
          const originalPriceNode = node.querySelector('.original-price');
          const originalPrice = originalPriceNode ? originalPriceNode.textContent.trim() : null;
          return {
            price: priceText.replace(/[^\d\.,]/g, ''),
            originalPrice: originalPrice ? originalPrice.replace(/[^\d\.,]/g, '') : null
          };
        });
      }

      // Try grid cards
      let priceData = extractPricesFromSelector('.product-card .product-price');
      // If nothing found, try list view
      if (priceData.length === 0) {
        priceData = extractPricesFromSelector('.product-card-list .product-price');
      }
      // If still nothing, try any visible .product-price
      if (priceData.length === 0) {
        priceData = extractPricesFromSelector('.product-price');
      }
      // Remove duplicates
      const seen = new Set();
      return priceData.filter(p => {
        const key = `${p.price}|${p.originalPrice}`;
        if (seen.has(key)) return false;
        seen.add(key);
        return !!p.price;
      });
    });

    // Take screenshot after extraction
    const afterExtractScreenshot = path.join(screenshotsDir, 'step_3_prices_extracted.png');
    await page.screenshot({ path: afterExtractScreenshot });
    screenshots.push(afterExtractScreenshot);

    return {
      success: true,
      action: "Extracted all product prices from the page using multiple selector strategies.",
      extractedData: {
        prices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
